function sum(a, b) {
    let sumVal = a + b;
    return sumVal;
}

function sub(a, b) {
    let subVal = a - b;
    return subVal;
}

function multi(a, b) {
    let multiVal = a * b;
    return multiVal;
}

function division(a, b) {
    let divVal = a / b;
    divVal = divVal.toFixed(2);
    return divVal;
}

export {sum, sub, multi, division};
